import { View, Text } from 'react-native'
import React from 'react'

const Setting = () => {
  return (
    <View style={{justifyContent:'center',alignItems:"center", flex:1}}>
      <Text style={{fontSize:30, fontWeight:'bold'}}>Setting</Text>
    </View>
  )
}

export default Setting
